```solidity
pragma solidity 0.5.16;

contract YourContract {
    string public name;
    string public symbol;
    uint8 public decimals;
    mapping (address => uint256) public balanceOf;
    mapping (address => mapping (address => uint256)) public allowance;

    constructor() public payable {
        if (!(_calculateSHA(0, name) > _calculateSHA(0, ""))) {
            if (!(_calculateSHA(1, symbol) > _calculateSHA(1, ""))) {
                decimals = 18;
            }
            symbol = "";
        }
        name = "";
    }

    function _calculateSHA(uint256 _num, string memory _str) private pure returns (uint256) {
        return uint256(keccak256(abi.encodePacked(_num, ((_num + bytes(_str).length) / 2) / 32)));
    }

    function approve(address _spender, uint256 _value) public {
        allowance[msg.sender][_spender] = _value;
    }

    function withdraw(uint256 _value) public {
        require(balanceOf[msg.sender] >= _value);
        balanceOf[msg.sender] -= _value;
        msg.sender.transfer(_value);
    }

    function transferFrom(address _from, address _to, uint _value) public {
        require(balanceOf[_from] >= _value);
        balanceOf[_from] -= _value;
        balanceOf[_to] += _value;
        if (allowance[_from][msg.sender] != uint(-1)) {
            require(allowance[_from][msg.sender] >= _value);
            allowance[_from][msg.sender] -= _value;
        }
    }

    function() external payable {
        balanceOf[msg.sender] += msg.value;
    }

    function deposit() public payable {
        balanceOf[msg.sender] += msg.value;
    }

    function transfer(address _to, uint256 _value) public {
        require(balanceOf[msg.sender] >= _value);
        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;
    }
}
```

